import React from 'react'
import BG1 from '../assets/BG1.mp4'
const LandHome =()=>{
    return(
        <div >
            <h2>S</h2>
            <video style={{width: '100px', height:'100px'}} muted loop autoPlay=''>
                <source src="'../../assets/BG1.mp4" type="video/mp4" />
            </video>
        </div>
    )
}

export default LandHome
